INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Urbanista-Kopfhörer/Urbanista Paris.webp;', 'Urbanista Paris', 'https://www.amazon.de/Urbanista-Kopfh%C3%B6rer-Ger%C3%A4uschd%C3%A4mpfende-Touch-Steuerung-eingebautem-Midnight-Black/dp/B081ND1TT7/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=12WZ966PGKZH6&keywords=Urbanista+Paris&qid=1667233663&qu=eyJxc2MiOiIyLjU5IiwicXNhIjoiMi40MCIsInFzcCI6IjIuMjYifQ%3D%3D&sprefix=%2Caps%2C66&sr=8-3', '54,30', 3.7, 1619, 1, '-;Urbanista;Erwachsener;Bluetooth;Ohrhörer (Earbuds);Kabellos;【Wahrhaft Kabellos INDIVIDUELLE PASSFORM】Nicht wie andere Im-Ohr-Kopfhörer, das neue Pariser Silikon-Ohrhörer-Design sorgt dafür, dass Ihre Kopfhörer jederzeit sicher im Ohr bleiben. Kompatibel mit IOS- und Android-Geräten für Ihren Komfort über Bluetooth 5.0|【Wahrhaft Kabellos FUNKTIONEN】Mit eingebautem Mikrofon und kompatibel mit Siri und Google Now, war die Nutzung der Sprachunterstützung und das Telefonieren unterwegs nie einfacher. Die wasserdichte IPX5 gibt Ihnen die Gewissheit, dass Sie mit Ihren Lieblingssongs im Regen laufen können.|【Wahrhaft Kabellos FREIHEIT】Die Ohrhörer bieten Ihnen eine hervorragende Klangqualität, verstärkt durch eine passive Geräuschunterdrückung, um sicherzustellen, dass Ihr wahres drahtloses Kopfhörerlebnis während der Reise nicht unterbrochen wird. Die Touch-Steuerung macht es einfach, nahtlos zwischen Musik und Anrufen zu navigieren.|【Wahrhaft Kabellos LADEGEHÄUSE】Laden Sie Ihre Kopfhörertasche drahtlos auf! Die schlanke kabellose Ladehülle ermöglicht eine 5-stündige Aufladung des Paris in nur 1,5 Stunden und ist mit allen Qi-zertifizierten Ladegeräten kompatibel. Sie können die Kopfhörer mit dem Ladegerät bis zu 3 mal aufladen, was Ihnen bis zu 20 Stunden Gesamtspielzeit und bis zu 110 Stunden Standbyzeit ermöglicht.|【Wahrfaft Kabellos AUDIO】Paris Bluetooth Kopfhörer werden in enger Zusammenarbeit mit dem berühmten Toningenieur Axel Grell entwickelt. Das Ergebnis ist eine hervorragende Klangqualität. Bringen Sie Ihre Lieblingsmusik mit, wann und wo immer Sie wollen.');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Urbanista-Kopfhörer/Urbanista Seattle.webp;', 'Urbanista Seattle', 'https://www.amazon.de/Urbanista-Bluetooth-Kopfh%C3%B6rer-EINZIGARTIGER-URBANISTA-Sound-Wiedergabezeit-Rotgold/dp/B01LZ6TZ85/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=XQZS0FWAY0MQ&keywords=Urbanista+Seattle&qid=1667233669&qu=eyJxc2MiOiIwLjU0IiwicXNhIjoiMC41MCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=urbanista+paris%2Caps%2C103&sr=8-1', '34,05', 4.4, 39, 2, 'red,goldenrod;Urbanista;Erwachsener;Bluetooth;Ohraufliegend;Kabellos;Urbanista Seattle Wireless gold');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Urbanista-Kopfhörer/Urbanista Stockholm Plus.webp;', 'Urbanista Stockholm Plus', 'https://www.amazon.de/Urbanista-Stockholm-Earbuds-kabellos-Ear-Kopfh%C3%B6rer-Mitternachtsschwarz/dp/B08DG4S25R/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1QARKEA5VR9PB&keywords=Urbanista+Stockholm+Plus&qid=1667233675&qu=eyJxc2MiOiIxLjgyIiwicXNhIjoiMS40MyIsInFzcCI6IjEuMjMifQ%3D%3D&sprefix=%2Caps%2C74&sr=8-3', '49,99', 4.0, 1565, 0, 'black;Urbanista;Erwachsener;Bluetooth;Ohrhörer (Earbuds);Kabellos;【 Verbesserte Technologie 】 Unsere Bluetooth-Kopfhörer bieten jetzt 20+ Stunden Spielzeit, mit Ladestation für 5 extra Aufladungen. Noch schnellere Ladezeit von 1,5 Stunden mit Ladefunktion Typ C, plus Reset-Taste und LED-Ladeanzeige auf dem Gehäuse|Kabellose Kopfhörer mit Bluetooth von Stockholm Plus sind elegante Ohrhörer und zeichnen sich durch einen 【 atemberaubenden Klang 】 aus. Egal, ob eindrucksvolle Musikerlebnisse oder eine hervorragende Klangqualität beim Hören von Podcasts, unsere Earbuds Bluetooth-Kopfhörer haben ein besonders leichtes Design und einen perfekten Sitz|【 Komplette Headset-Funktionen 】 Unsere kabellosen In-Ear-Kopfhörer bieten zusätzlich ein verbessertes Mikrofon, um die Sprachunterstützung zu nutzen und Anrufe per Sprachsteuerung zu tätigen. Gleichzeitig wird sichergestellt, dass Ihre Stimme bei Anrufen die Hintergrundgeräusche klar und deutlich durchdringt|Unsere kabellosen Bluetooth-Kopfhörer sind mit einer intuiven 【 Berührungssteuerung 】 ausgestattet. Sie können mit einer einfachen Berührung durch Ihre Musik navigieren, die Lautstärke anpassen und Anrufe entgegennehmen. True Wireless war noch nie so einfach, wie mit unseren Urbanista Kopfhörern|【 Unverwechselbares Design 】 Unsere In-Ear-Kopfhörer sind jetzt in 5 eleganten Farben erhältlich, die mit jedem Smartphone oder Gerät kompatibel sind. Sie sind nach IPX4 wasserdicht womit gewährleistet ist, dass Ihre Bluetooth In-Ear-Pods allen Anforderungen an einen aktiven Lebensstil gerecht werden');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Urbanista-Kopfhörer/Urbanista Miami.webp;', 'Urbanista Miami', 'https://www.amazon.de/Urbanista-Bluetooth-Cancelling-kabelloses-Tragetasche-White-Pearl/dp/B08TM89RK6/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=32UKE2T4F38BS&keywords=Urbanista+Miami&qid=1667233680&qu=eyJxc2MiOiIyLjU1IiwicXNhIjoiMi4wNCIsInFzcCI6IjEuNzUifQ%3D%3D&sprefix=%2Caps%2C78&sr=8-3', '137,16', 3.9, 266, 3, '-;Urbanista;Erwachsener;Bluetooth;Ohrumschließend;Kabellos;【 Noise Cancelling Kopfhoerer 】Konzentration und Dynamik mit den Urbanista Miami Over Ear Bluetooth Kopfhörern. Unsere aktive Geräuschunterdrückung sorgt für ein klares Klangerlebnis, während der Umgebungsgeräuschmodus die Möglichkeit bietet, wichtige Geräusche herauszufiltern, ohne den Klang zu stören|【 Bluetooth Kopfhörer Over-Ear 】Genießen Sie das wahre kabellose Hörerlebnis mit 50 Stunden ununterbrochener Spielzeit. Unsere integrierte On-Ear-Erkennung pausiert Ihre Musik, wenn Sie den Kopfhörer abnehmen, und startet sie neu, wenn Sie ihn wieder aufsetzen. Verbinden Sie sich mühelos über die Technologie Bluetooth 5.0 mit Ihrem iOS/Android-Gerät.|【 Vollständig Verstellbar 】Unsere schlanken, kabellosen Kopfhörer sind vollständig verstellbar und verfügen über ein robustes Metallscharnier, wobei die gepolsterten Ohrmuscheln aus PU-Leder den ganzen Tag über einen hohen Tragekomfort bieten. Verwenden Sie unser Bluetooth-Headset als Gaming-Kopfhörer, Studio-Kopfhörer oder zum Hören von Beats, Podcasts und mehr|【 Speziell für ein Aktives Leben 】Im Lieferumfang unserer kabellosen Kopfhörer ist ein robustes Etui enthalten, das speziell für ein aktives Leben oder das tägliche Pendeln geeignet ist. Das Case bietet auch Platz für das Ladekabel und einen Flugadapter, damit Sie Ihr gesamtes Urbanista-Zubehör sicher aufbewahren können|【 Multifunktionstaste 】Unsere kabellosen Kopfhörer haben eine Multifunktionstaste, mit der Sie die Lautstärke regeln, Titel pausieren/abspielen/überspringen und Ihren Sprachassistenten aktivieren können. Urbanista Miami Kopfhörer werden in einer sorgfältig durchdachten und vollständig nachhaltigen Verpackung geliefert, ohne unnötiges Plastik oder Lacke.');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Urbanista-Kopfhörer/Urbanista London.webp;', 'Urbanista London', 'https://www.amazon.de/Urbanista-Kopfh%C3%B6rer-Cancelling-Integriertes-Kompatibel-Mitternacht-Schwarz/dp/B08CVQBM84/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=19FZ6L3VLD3ZY&keywords=Urbanista+London&qid=1667233686&qu=eyJxc2MiOiIyLjAwIiwicXNhIjoiMS43NyIsInFzcCI6IjEuODcifQ%3D%3D&sprefix=urbanista+miami%2Caps%2C73&sr=8-3', '79,95', 3.6, 578, 0, 'black;Urbanista;Erwachsener;Bluetooth;Ohrhörer (Earbuds);Kabellos;Aktive Noise Cancelling Kopfhörer 【 Urbanista 】 nutzen eine Reihe hochentwickelter Mikrofone und eine integrierte Verarbeitung, um unerwünschte Hintergrundgeräusche von Ihren Bluetooth-Kopfhörern mit einer einzigen Berührung vollständig zu unterdrücken|Bewegungssensoren 【 In Ear Erkennung 】 erkennen, wenn Sie einen Ohrhörer abnehmen, und unterbrechen Ihre Beats oder Videos automatisch. Die Bluetooth-Ohrhörer in den maßgefertigten Silikon-Ohrstöpseln bieten einen bequemen Sitz, ideal als Sport- oder Laufkopfhörer|【 Mit der Berührungssteuerung 】 können Sie Abspielen/Pausieren, die Lautstärke erhöhen/verringern, Anrufe annehmen/beenden und die aktive Geräuschunterdrückung ein-/ausschalten. Mit unseren Ohrhörern mit drahtloser Bluetooth-Technologie können Sie Anrufe freihändig über unsere Ohrhörer mit Mikrofon annehmen oder beenden.|Laden Sie kabellose Kopfhörer mit Bluetooth an jedem Qi-zertifizierten Pad in weniger als einer Stunde auf. 【 Kabelloses Aufladen 】 Unsere Ladetasche im Taschenformat fasst zusätzlich 4 Ladungen und verleiht den Bluetooth-Kopfhörern eine beeindruckende Akkulaufzeit von 25 Stunden.|【 Raumklang-Modus 】 Mit unserem Mikrofon und unserer Klangverarbeitungstechnologie haben Sie die Möglichkeit, Hintergrundgeräusche klar und deutlich über Ihre Bluetooth-Kopfhörer und definierte Stimmen zu hören, ohne die Lautstärke Ihrer drahtlosen Ohrhörer zu verringern.');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Urbanista-Kopfhörer/Urbanista Athens.webp;', 'Urbanista Athens', 'https://www.amazon.de/Urbanista-Kopfh%C3%B6rer-Wasserdicht-Ladetasche-Im-Ohr-Kopfh%C3%B6rer-Schwarz/dp/B07SFLVLL8/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1ZZJNNW08P01C&keywords=Urbanista+Athens&qid=1667233692&qu=eyJxc2MiOiIxLjY5IiwicXNhIjoiMS4yNiIsInFzcCI6IjAuNjIifQ%3D%3D&sprefix=urbanista+london%2Caps%2C76&sr=8-3', '124,03', 3.5, 317, 0, 'black;Urbanista;Erwachsener;Bluetooth;Ohrhörer (Earbuds);Kabellos;【 Wahrhaft Kabellos FREIHEIT 】 Athens Ohrhörer bieten Ihnen echten kabellosen Musikgenuss und Freiheit, kompatibel mit IOS- und Android-Geräten für Ihren Komfort über Bluetooth 5.0. Das Design ist perfekt für den Sport und enthält 3 Paar GoFits - eine Silikonschlaufe, die die Ohrhörer fest im Ohr hält|【 Wahrhaft Kabellos WASSERFEST 】 Mit den Urbanista Kabellose Ohrhörer IP67 rated wasserdicht, ist ein Lauf bei starkem Regen, ein Tag auf dem Surfbrett oder ein Spin in der Waschmaschine für diese Ohrhörer kein Problem|【 Wahrhaft Kabellos AUDIO 】 Die Bluetooth-Kopfhörer von Athens werden in Zusammenarbeit mit dem Toningenieur Axel Grell entwickelt. Neben klaren Mitten und Höhen liegt der Schwerpunkt auf dem Bassbereich, der es Ihren neuen Kopfhörern ermöglicht, sich in allen Sportarten zu behaupten|【 Wahrhaft Kabellos LADEGEHÄUSE 】 Die schlanke Ladehülle ermöglicht eine 8-stündige Aufladung der Kopfhörer in nur 1 Stunde. Sie können die Kopfhörer mit dem Ladegerät bis zu 3 mal aufladen, was Ihnen bis zu 32 Stunden Gesamtspielzeit und bis zu 400 Stunden Standby ermöglicht|【 Wahrhaft Kabellos FUNKTIONEN 】 Mit eingebautem Mikrofon und kompatibel mit Siri und Google Now, war die Nutzung der Sprachunterstützung und das Telefonieren unterwegs nie einfacher. Die verbesserte Geräuschunterdrückung der Ohrhörer blockiert Hintergrundgeräusche');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Urbanista-Kopfhörer/Urbanista Lisbon.webp;', 'Urbanista Lisbon', 'https://www.amazon.de/Urbanista-Bluetooth-Gesamtspielzeit-Sprachassistent-Mitternachtsschwarz/dp/B09JKRYHT8/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3V7SEDK6A1CG&keywords=Urbanista+Lisbon&qid=1667233698&qu=eyJxc2MiOiIxLjc0IiwicXNhIjoiMS40MyIsInFzcCI6IjEuMjMifQ%3D%3D&sprefix=%2Caps%2C79&sr=8-3', '49,99', 3.8, 269, 0, 'black;Urbanista;Erwachsener;Bluetooth;Ohrhörer (Earbuds);Kabellos;【 Freiheit neu erleben 】 Verliere dich in einem farbenfrohen Tagtraum mit Urbanista Lisbon. Die kabellosen Kopfhörer geben dir die Freiheit, deine Musik jederzeit und überall zu hören. Die kompaktesten Ohrstöpsel, die wir je hergestellt haben, bieten dir ein kaum spürbares Hörerlebnis, und liefern dennoch kraftvolle, laute Bässe und einen erstklassigen, kristallklaren Klang.|【 Schlank und funktional 】Die Kopfhörer Urbanista Lisbon verkörpern die Schlichtheit unseres skandinavischen Designs. Sie sind klein und mit nur 4 Gramm pro Kopfhörer erstaunlich leistungsstark. Leicht zu tragen und mit einem Klang, der bleibenden Eindruck hinterlässt.|【 Lang anhaltende Spielzeit 】Urbanista Lisbon hält mit einer vollen Ladung 9 Stunden und dank der zwei zusätzlichen Ladungen in der kompakten Ladehülle kannst du insgesamt 27 Stunden lang deine Lieblingstitel hören.|【 Wahre Schlichtheit 】 Urbanista Lisbon Earbuds sind mit Touch Control ausgestattet, damit du die Hände frei hast und es unterwegs nicht zu kompliziert wird. Außerdem bieten sie unseren universellen GoFit Wing, der für einen passgenauen Sitz in jeder Ohrgröße sorgt.|【 Absolut Kompatibel 】Du kannst Urbanista Lisbon mit jedem Bluetooth-Gerät verbinden, um zu Hause oder unterwegs bequem Musik zu hören. Kompatibel mit Android und iPhone, kannst du Siri und den Google Sprachassistent mit deinen Lisbon Kopfhörern verbinden und so ein nahtloses mobiles Erlebnis mit Sprachsteuerung genießen.');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Urbanista-Kopfhörer/Urbanista Berlin.webp;', 'Urbanista Berlin', 'https://www.amazon.de/Urbanista-magnetische-Bluetooth-Kopfh%C3%B6rer-Wiedergabezeit-Telefonieren/dp/B01LYQAJUE/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3F6DFREMU31AZ&keywords=Urbanista+Berlin&qid=1667233704&qu=eyJxc2MiOiIyLjEzIiwicXNhIjoiMS4zOCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C92&sr=8-3', '36,58', 3.6, 181, 0, '-;Urbanista;Erwachsener;Bluetooth;Earbuds;Kabellos;Ihr täglicher begleiter für grenzenlosen musikgenuss: Leicht zu bedienende Kopfhörer mit bequemer Passform in modernem Design. Nach einer kurzen Aufladezeit von etwas über einer Stunde können Sie bereits wieder bis zu 4&nbsp;Stunden lang unterwegs Ihre Lieblingsmusik kabellos per Bluetooth V4.1 hören.|Außergewöhnlicher Klang: Die Berlin Kopfhörer sorgen für ein unverwechselbares Audiovergnügen mit kristallklaren Höhen und sattem Klang aus 13,2&nbsp;mm-Lautsprechern – ob Sie nun Ihre Lieblingsmusik hören oder mit einem Freund telefonieren.|Hybrides Ergonomisches Design: Die Ohrstöpsel sind ergonomisch perfekt geformt. Die praktische, in das Kabel integrierte Fernbedienung verfügt über ein Mikrofon und Tasten zur Lautstärkeregelung – Sie müssen also unterwegs nicht erst Ihr Gerät aus der Tasche holen, um Anrufe anzunehmen oder die Musikwiedergabe zu steuern.|Komfort: Die Berlin Kopfhörer sind für den täglichen Gebrauch mit Silikon-Ohrstöpseln ausgestattet. Wenn die Kopfhörer sicher sitzen sollen, können Sie die Ohrstöpsel gegen die mitgelieferten GoFit-Silikonbügel austauschen – perfekt beim Sport oder wenn es mal etwas hektischer wird.|Skandinaviches Design: Das flache Kabel verheddert sich nicht und ist ebenso praktisch wie stylisch. Außerdem können die Ohrhörer magnetisch miteinander verbunden werden. So können sie um den Hals getragen werden und sind stets griffbereit.');
