rdicht womit gewährleistet ist, dass Ihre Bluetooth In-Ear-Pods allen Anforderungen an einen aktiven Lebensstil gerecht werden');
INSERT INTO `urbanista-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/Urbanista-Kopfhörer/Urbanista Copenhagen.webp;', 'Urbanista Copenhagen', 'https://www.amazon.de/Urbanista-Copenhagen-Touch-Bedienung-Wasserabweisend-Mitternachtsschwarz/dp/B0BGYD1ZPD/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=36XJ1WSQ40D9&keywords=Urbanista+Copenhagen&qid=1667233715&sprefix=urbanista+c%2Caps%2C97&sr=8-1', '69,00', 0.0, 0, 0, 'black;Urbanista;Erwachsener;Bluetooth;-;Kabellos;MÜHELOSER KOMFORT: Mit Urbanista Copenhagen kannst du deine Lieblingssongs jederzeit und überall hören. Mit ihrem minimalistischen Design und der True-Wireless-Funktion mit Bluetooth 5.2 kannst du deine Musik auch unterwegs ohne Unterbrechung hören. Die perfekte Balance zwischen Form und Funktion: Copenhagen Earbuds sind leicht und sitzen mühelos und komfortabel im Ohr - den ganzen Tag lang|MÜHELOSES HÖREN: Eine Spielzeit von 8 Stunden in jedem Ohrstöpsel und weitere drei Aufladungen in der mitgelieferten USB-C-Ladehülle sorgen für insgesamt 32 Stunden Musikwiedergabe, damit du nie ohne deine Musik unterwegs bist. Dank der Touch-Bedienung kannst du mit einem einfachen Druck zwischen den Titeln wechseln, was die Copenhagen Kopfhörer zum idealen Accessoire für ein Leben in Bewegung macht. Einfach aufladen und den Tag mit Musik verbringen|MÜHELOSER STIL: Copenhagen ist in vier Farben erhältich, die zu jedem Stil passen und es dir ermöglichen, dich im mühelosen Scandi-Chic auszudrücken, mit einer einfachen und eleganten Ästhetik und einer kleinen, kompakten Bauweise. Sie sind nach IPX4 wasserabweisend und damit schweiß- und spritzwassergeschützt, ideal für den Einsatz beim Laufen und Training sowie leicht zu reinigen für lang anhaltenden Sound.|MÜHELOSE FUNKTION: Ubanista Copenhagen bieten ein Mikrofon mit Geräuschunterdrückung für kristallklare Spracherkennung, das störende Hintergrundgeräusche ausblendet. Chatte in hervorragender Klarheit mit Freunden und Familie oder verbinde die Bluetooth In Ear Kopfhörer mit Siri und dem Google-Sprachassistenten für einfaches Freisprechen.|MÜHELOSER KLANG: Der leistungsstarke und dynamische 12 mm Treiber von Urbanista Copenhagen sorgt für kräftige Bässe und klare Klänge, mit denen du deine Lieblingssongs noch intensiver genießen kannst. Die Urbanista App gibt dir die volle Kontrolle über deinen Sound und ermöglicht dir, deine Musikprofile beliebig anzupassen.');
